import React, { useState } from "react";
import "./tech-bio-card.component.css";

function TechBioCardComponent() {
  const [name, setName] = useState("Eugenia Duodu");
  const [job, setJob] = useState("TECHNOLOGY");
  const [description, setDescription] = useState(
    "This is a brief description about so and so "
  );

  return (
    <div className="tech-bio-card">
      <div className="upper-container">
        <img
          className="portrait"
          src="stempics/eugenia-duodu.jpg"
          alt="eugenia  duodu"
          height="230px"
          styles={{ backgroundPosition: "center" }}
        />
        <div className="image-container">
          <img
            src="images/logos/computer.png"
            alt="logo"
            width="25px"
            height="25px"
          />
        </div>
      </div>
      <div className="lower-container">
        <h3>{name}</h3>
        <h4>{job}</h4>
        <p>{description}</p>
      </div>
    </div>
  );
}

export default TechBioCardComponent;
